import { Link } from "react-router-dom";

export default function PlacesPage(){
    return(
        <div>
            <div>
                <div className="text-center">
                    <Link className="bg-primary text-white py-2 rounded-full px-6" to={'/account/places/new'}>
                    <div></div>
                    Add New Places</Link>
                </div>
            </div>
        </div>
    )
}
